import React from 'react';
import {showForm} from "../../actions";

function Button({dispatch,enabled,showElement}) {
    return (
        <button
            className={'ui button'}
            onClick={e => {
                e.preventDefault();
                dispatch(showForm(showElement));
            }}
        >{enabled ? "Hide Form": "Show Form" }</button>
    )
}

export default Button
